INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (1, "2030/12/17 14:59:59", 0.0, 1, 102601, 24001, 0.0, 0, "リン", "2020/04/30 12:00:00", 0.0, 24, 10040, "あたしだって\nやるときはやるよ！");
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (1, "2030/12/17 14:59:59", 0.0, 1, 102601, 24002, 0.0, 1, "リン", "2020/04/30 12:00:00", 0.0, 24, 10040, "ふぅ…\nこれであたしの仕事は\n終わりだね");
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (1, "2030/12/17 14:59:59", 0.0, 1, 102601, 24003, 0.0, 2, "リン", "2020/04/30 12:00:00", 0.0, 24, 10040, "終わった終わった\n一人でもなんとか\nなるもんだね");
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (2, "2030/12/17 14:59:59", 0.0, 2, 102601, 24004, 0.0, 3, "リン", "2020/04/30 12:00:00", 0.0, 24, 10040, "やったね！\nこれでようやく\nサボれるよ…");
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (1, "2030/12/17 14:59:59", 0.0, 1, 102601, 24005, 0.0, 4, "リン", "2020/04/30 12:00:00", 0.0, 24, 10040, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ");
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (2, "2030/12/17 14:59:59", 0.0, 2, 102601, 24006, 0.0, 5, "リン", "2020/04/30 12:00:00", 0.0, 24, 10040, "あたしを敵に回した\n恐ろしさ\n思い知ったか！");
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (2, "2030/12/17 14:59:59", 0.0, 2, 102601, 24007, 0.0, 6, "リン", "2020/04/30 12:00:00", 0.0, 24, 10040, "あたしも意外と\nやるもんでしょ？");
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (4, "2030/12/17 14:59:59", 0.0, 4, 102601, 24008, 0.0, 7, "リン", "2020/04/30 12:00:00", 0.0, 24, 10040, "疲れた…\nねずみの逃げ足\n速すぎるよ…");
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (4, "2030/12/17 14:59:59", 0.0, 4, 102601, 24009, 0.0, 8, "リン", "2020/04/30 12:00:00", 0.0, 24, 10040, "このままじゃ\nまっひ～に\n叱られちゃうよ");
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (4, "2030/12/17 14:59:59", 0.0, 4, 102601, 24010, 0.0, 9, "リン", "2020/04/30 12:00:00", 0.0, 24, 10040, "まじめに\nやったんだけどな…\n悔しいな～");
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (4, "2030/12/17 14:59:59", 0.0, 4, 102601, 24011, 0.0, 10, "リン", "2020/04/30 12:00:00", 0.0, 24, 10040, "やられた…\nねずみって意外と\nてごわいね");
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (4, "2030/12/17 14:59:59", 0.0, 4, 102601, 24012, 0.0, 11, "リン", "2020/04/30 12:00:00", 0.0, 24, 10040, "おのれ～\nあたしのチーズを\n盗みやがって～！");
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (4, "2030/12/17 14:59:59", 0.0, 1, 102601, 24013, 0.0, 12, "リン", "2020/04/30 12:00:00", 1.81, 24, 10040, "疲れた…\nけど、次こそは\n守り抜くよ…");
